  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-salinity-and-nutrient-data-from-bottle-casts-from-the-north-atlantic-and-norwegian-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bottle and other data were collected from
  the North Atlantic and Norwegian Sea from the AKADEMIK KURCHATOV and CRILION from
  29 November 1970 to 20 September 1975. Data were submitted by the USSR Academy of
  Science; Institute of Oceanology. Additional funding for digitizing historic data
  were provided by the Global Ocean Data Archaeology and Rescue (GODAR) project. Data
  include profiles of temperature, pH, alkalinity, salinity and oxygen. Data also
  include concentration profiles of chlorophyll a, nitrate, nitrite, phosphate and
  silicate.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
